pragma solidity ^0.8.0;

contract Box {
  uint256 private value;
  event ValueChanged(uint256 value);

  function setValue(uint256 _value) public {
    value = _value;
    emit ValueChanged(value);
  }

  function getValue() public view returns (uint256) {
    return value;
  }
}

